CKEDITOR.plugins.setLang("a11yhelp","hr",{title:"Upute dostupnosti",contents:"Sadr\u017eaj pomo\u0107i. Za zatvaranje pritisnite ESC.",legend:[{name:"Op\u0107enito",items:[{name:"Alatna traka",legend:"Pritisni ${toolbarFocus} za navigaciju do alatne trake. Pomicanje do prethodne ili sljede\u0107e alatne grupe vr\u0161i se pomo\u0107u SHIFT-TAB i TAB. Pomicanje do prethodnog ili sljede\u0107eg gumba u alatnoj traci vr\u0161i se pomo\u0107u lijeve i desne strelice kursora. Pritisnite SPACE ili ENTER za aktivaciju alatne trake."},{name:"Dijalog",legend:"Unutar dijaloga, pritisnite TAB za navigaciju do sljede\u0107eg polja, pritisnite SHIFT + TAB za vra\u0107anje na prethodno polje, pritisnite ENTER za slanje dijaloga ili ESC za zatvaranje dijaloga. Za dijaloge koji imaju vi\u0161estruke kartice, pritisnite ALT + F10 za na navigaciju i zatim TAB ili lijeva strelica kursora ili SHIFT + TAB i desna strelica kursora. SPACE ili ENTER odabiru karticu."},{name:"Kontekstni izbornik",legend:"Pritisnite ${contextMenu} ili APPLICATION tipku za otvaranje kontekstnog izbornika. Pomicanje se vr\u0161i TAB ili strelicom kursora prema dolje ili SHIFT+TAB ili strelica kursora prema gore. SPACE ili ENTER odabiru opciju izbornika. Otvorite podizbornik trenutne opcije sa  SPACE, ENTER ili desna strelica kursora. Povratak na prethodni izbornik vr\u0161i se sa ESC ili lijevom strelicom kursora. Zatvaranje se vr\u0161i pritiskom na tipku ESC."},{name:"Lista",legend:"Unutar list-boxa, pomicanje na sljede\u0107u stavku vr\u0161i se sa TAB ili strelica kursora prema dolje. Na prethodnu sa SHIFT + TAB ili strelica prema gore. Pritiskom na SPACE ili ENTER odabire se stavka ili ESC za zatvaranje."},{name:"Traka putanje elemenata",legend:"Pritisnite ${elementsPathFocus} za navigaciju po putanji elemenata. Pritisnite TAB ili desnu strelicu kursora za pomicanje na sljede\u0107i element ili SHIFT + TAB ili lijeva strelica kursora za pomicanje na prethodni element. Pritiskom na SPACE ili ENTER vr\u0161i se odabir elementa."}]},{name:"Naredbe",items:[{name:"Vrati naredbu",legend:"Pritisni ${undo}"},{name:"Ponovi naredbu",legend:"Pritisni ${redo}"},{name:"Bold naredba",legend:"Pritisni ${bold}"},{name:"Italic naredba",legend:"Pritisni ${italic}"},{name:"Underline naredba",legend:"Pritisni ${underline}"},{name:"Link naredba",legend:"Pritisni ${link}"},{name:"Smanji alatnu traku naredba",legend:"Pritisni ${toolbarCollapse}"},{name:"Access previous focus space naredba",legend:"Pritisni ${accessPreviousSpace} za pristup najbli\u017eem nedostupnom razmaku prije kursora, npr.: dva spojena HR elementa. Ponovnim pritiskom dohvatiti \u0107e se sljede\u0107i nedostupni razmak."},{name:"Access next focus space naredba",legend:"Pritisni ${accessNextSpace} za pristup najbli\u017eem nedostupnom razmaku nakon kursora, npr.: dva spojena HR elementa. Ponovnim pritiskom dohvatiti \u0107e se sljede\u0107i nedostupni razmak."},{name:"Pomo\u0107 za dostupnost",legend:"Pritisni ${a11yHelp}"}]}]});